
/// Fabrix PhotoShop FAV Export

/// Make G-Code by Illustrator and export it to Photoshop (with Layers)
/// Photoshop can export .FAV file by this script 

/// (C) Hiroya Tanaka 
/// 2017.08.09 





file = app.openDialog();//opens dialog,choose one image

var f = new File(file[0])
f.open('r')
var xml = new XML( f.read() ) 
f.close() 




var x = xml.object[0].grid[0].dimension[0].x[0].toString()
var y = xml.object[0].grid[0].dimension[0].y[0].toString()
var z = xml.object[0].grid[0].dimension[0].z[0].toString()

alert("Voxel Resolution: x:"+ x + " - y:" + y + " - z:" + z)


app.documents.add(parseInt(x),parseInt(y),72,"FAV_Import",NewDocumentMode.RGB)

var docRef = app.activeDocument;

var i
var k

for (i=1; i<=parseInt(z); i++){
var layerRef = app.activeDocument.artLayers.add()
layerRef.name = i.toString()
}


var xx
var yy


		
for (i=1; i<=parseInt(z); i++){

var k
k=0

docObj = activeDocument;
docObj.activeLayer = docObj.layers[z-i];
var j = xml.object[0].structure[0].color_map[0].child(i-1).toString()
	
for (yy=0; yy<parseInt(y); yy++){
	for (xx=0; xx<parseInt(x); xx++){




var jj= j.substr(k,2)
var jjj =  parseInt(jj, 16)

var jj= j.substr(k+2,2)
var jjjj =  parseInt(jj, 16)

var jj= j.substr(k+4,2)
var jjjjj =  parseInt(jj, 16)



//alert(xx + " : " + yy + " : ... " + jjj + " - " + jjjj + " - " + jjjjj)

  var strokeColor = new SolidColor()
  strokeColor.rgb.red   = jjj
  strokeColor.rgb.green = jjjj
  strokeColor.rgb.blue  = jjjjj

  var selReg
  selReg = [[xx,yy],[xx+1,yy],[xx+1,yy+1],[xx,yy+1]]
 


  activeDocument.selection.select(selReg)
  activeDocument.selection.fill(strokeColor,ColorBlendMode.NORMAL, 100, false)

k=k+6




}
}
}
   
